import Head from "next/head";
import Navbar from "./Navbar";

const Layout = (props) => (
    <>
        <Head>
            <title>LMS</title>
            <link rel="stylesheet" href="https://bootswatch.com/4/cerulean/bootstrap.min.css"/>
        </Head>
        <Navbar/>
        <div className="container">
        {props.children}
        </div>

    </>

);
export default Layout;
